import React from 'react'
import { useState, useEffect } from 'react'

export default function Items() {
  useEffect(()=>{
    getData()
  },[])
  const [data, setData] = useState([]);

  fetch('items.json').then(res => res.json()).then(data => setData(data))

  return (
    <main>
      {data.map(el => (
        <h1>{el.title}</h1>
      ))}
    </main>
  )
}
